INSERT INTO `main_menu` (`ID`, `Номер`, `Название`, `Ссылка`, `Заголовок`, `Описание`, `Телефон`, `Фон`) VALUES
	(1, 1, 'Главная', 'main_page', 'СЕРВИСНЫЙ ЦЕНТР ПО РЕМОНТУ ТЕХНИКИ BOSCH', '<h2><small>Сломалась стиральная машина?</small> </h2>\r\n<h2><strong>Звоните, мы выезжаем</strong></h2>\r\n<p>Диагностика и ремонт стиральных машин на дому,</p>\r\n<p>выезд мастера в день оформления заявки,</p>\r\n<p> с гарантией до 12 месяцев</p>\r\n<br>\r\n<br>\r\n<br>', '123456789', 'img/logo1.png'),
	(2, 7, 'Контакты', 'contacts', 'КАК С НАМИ СВЯЗАТЬСЯ:', '<p><strong>Ремонт стиральных машин</strong></p><p><strong>Адрес:</strong> Москва, Преображенская пл., д. 8</p><p><strong>Телефон:</strong> 8 (405) 232-07-23</p><p>8 (405) 232-07-23</p>', '', NULL),
	(3, 3, 'Услуги', 'services', 'Что мы ремонтируем?', NULL, '', NULL),
	(4, 2, 'Выгода', 'benefit', 'НАШИ ПРЕИМУЩЕСТВА', 'В процессе ремонтно-восстановительных работ, может быть необходимой замена старых испорченных деталей. В таком случае мы обязуемся поставлять исключительно новые и оригинальные запчасти от лицензионной фирмы-производителя Bosch. Любая оказываемая услуга, завершается подписанием документа о гарантийном сопровождении. При сотрудничестве с сервисным центром, клиенты получают большое количество преимуществ. Предлагаем рассмотреть основные из них, вынесенные в нижеприведенном списке:', '', NULL),
	(6, 6, 'Прайс-лист', 'prices', 'СТОИМОСТЬ УСЛУГ:', NULL, NULL, NULL),
	(7, 4, 'Почему мы?', 'why', 'Работать с нами легко!', NULL, NULL, NULL);
