	(11, 4, 'Пользователи бытовой техники от производителя Bosch, могут сталкиваться с появлением различных неполадок в работе своих устройств. Некоторые поломки возникают в процессе повседневной, продолжительной эксплуатации и являются неизбежными, другие же неполадки связаны с выходом из строя тех или иных деталей из-за физических повреждений и системных сбоев. Учитывая широкий перечень моделей такой техники, как: пылесосы, холодильники, стиральные машины, блендеры, мясорубки, соковыжималки, электрочайники, мультиварки, кофемашины, очистители и увлажнители воздуха, хлебопечки, микроволновки, утюги, кондиционеры и так далее, при обнаружении серьёзных неисправностей, следует вызвать специалистов надежной мастерской для эффективного устранения проблем. Наш сервисный центр Bosch в Москве, предоставит вам высококвалифицированных экспертов, готовых обеспечить своим клиентам профессиональную поддержку при точном обнаружении и надлежащем устранении любого характера поломок, нарушающих исправную функци', NULL, NULL),
	(12, 6, '<p>В процессе ремонтно-восстановительных работ, может быть необходимой замена старых испорченных деталей. В таком случае мы обязуемся поставлять исключительно новые и оригинальные запчасти от лицензионной фирмы-производителя Bosch. Любая оказываемая услуга, завершается подписанием документа о гарантийном сопровождении. При сотрудничестве с сервисным центром, клиенты получают большое количество преимуществ. Предлагаем рассмотреть основные из них, вынесенные в нижеприведенном списке:</p>\r\n\r\n<p>1. Связь с представителями компании осуществляется ежедневно и доступна в приемлемое для клиента время. Вы можете получить консультационную помощь от операторов в телефонном режиме.</p>\r\n\r\n<p>2. Имеется услуга вызова курьера к месту нахождения пользователя и его неисправного устройства. Наш работник перевезет вашу технику Бош в мастерскую, а после выполнения соответствующего ремонта, доставит её обратно.</p>\r\n\r\n<p>3. Наши опытные специалисты проводят абсолютно бесплатную процедуру диагностики, позволяющую выявить любые сбои и неполадки для их последующего устранения.</p>\r\n\r\n<p>4. Действует лояльная ценовая политика и различные скидочные программы, а также акционные предложения.</p>\r\n\r\n<p>5. Использование только оригинальных запчастей и деталей, поставку которых реализует официальный производитель Bosch.</p>\r\n\r\n<p>6. Составление гарантийной договоренности на все предоставляемые сервисным центром услуги.</p>', NULL, NULL),
